import React from 'react';
import Slide from '../components/News-Carousel/News_Home'; 
/* import Carousel from "../components/News-Carousel/News_Home"; */
import SimpleImageSlider from "react-simple-image-slider";

/* import { Slide } from 'react-slideshow-image'; */
import background2 from './nkyv2xbkkbl51.png';

const images = [
  { url: {background2} },
  { url: {background2} },
  { url: {background2} },

];
  
const Home = () => {
  return (
    <div
      style={{
        display: '',
        justifyContent: 'center',
        alignItems: 'left',
        height: '100vh',
        backgroundColor: '#9398b5'
      }}
    >

    <div>
        <h1>Top News Articles</h1>
    </div>
     
    <div>
      <SimpleImageSlider
        width={896}
        height={504}
        images={images}
      />
    </div>

    </div>
  );
};

